    "Nesting Loggerhead Sea Turtle Activity Report 2000 and 1980-2000 Nesting Summary",nt"tracking_summary":
    {ntt"total": 14,ntt"recent": 3nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:57:13.250477",nt"name": "nesting-loggerhead-sea-turtle-activity-report-2000-and-1980-2000-nesting-summary",nt"isopen":
    false,nt"url": null,nt"notes": "This paper presents results from the 8th
    Annual Study (using Army Corp of Engineers funds) of nesting by the Atlantic Loggerhead
    sea turtle (Caretta caretta) along the Atlantic Ocean coastline in Virginia Beach,
    Virginia during 2000. All surveys were implemented by volunteers and staff of the
    Back Bay National Wildlife Refuge, Virginia Beach, Virginia, throughout the sea
    turtle nesting season. Two seasonal, full-time biological technicians were hired
    to search twenty-five miles of beach along the northern periphery of the nesting
    range of the Atlantic Loggerhead. Refuge biologists investigated two Loggerhead
    sea turtle crawls during the 2000 nesting season. The successful nesting attempt
    for the 2000 nesting season occurred July 11, 2000 on Back Bay NWR, 2.6 miles south
    of the Refuge beach ramp. It produced a nest of 112 eggs. Refuge employees captured
    the nesting Loggerhead female and Virginia Institute of Marine Science personnel
    applied flipper tags and a satellite transmitter. A second crawl, located at the
    southern end of False Cape State Park, provided no evidence of a nest. An employee
    at False Cape State Park sighted a third sea turtle crawl, however, tides obliterated
    it before the sighting could be confirmed. No nests or crawls were located along
    the oceanfronts of Sandbridge, the Virginia Beach Resort Area, or Fort Story. Night
    patrols were conducted from June 5-June 29 and July 26-August 4 by volunteers and
    Refuge employees, however no turtle was sighted or captured during this period.
    This report also includes an analysis of Loggerhead sea turtle nests and stranding
    data from 1980 to 2000.",nt"license_title": "License Not Specified",nt"extras":
